import React from "react";
import styled, { createGlobalStyle } from "styled-components";
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import "./indexpage.css";
import { FaUser, FaShoppingCart } from "react-icons/fa";
import users from './navitems.json'

const Header = styled.div`
`;

const LogoNav = styled.nav`
    display: flex;
    justify-content: space-between;
    background-color: #f6f7fc;
    height: 75px;
`;

const Logo = styled.img`
  width: 220px;
  ${'' /* padding: 10px 0px 0px 10px; */}
  margin: 10px 0px 0px 25px;
  display: flex;
  justify-content: flex-start;
`;

const Nav = styled.nav`
  ${'' /* overflow: hidden;
  background-color: #333; */}
    ${'' /* display: flex;
    width: 100%;
    background-color: #7d7d7d;
    height: 44px; */}
`;

const HeaderIndexComponent = () => {
  return (
    <>
      {/* write html tag as plain tag */}
      {/* &lt;h1&gt;hjhgkjhgk&lt;/h1&gt; */}
        <Header>
            <LogoNav>

                <div><Logo src="/images/materiallibrarylogo.png" alt="mlLogo"></Logo></div>
                {/* element 1 */}

                <div classNameName="mycontent">
                    <div className="dropdown">
                        <button className="dropbtn">Portfolios</button>
                        <div className="dropdown-content">
                            <li>Create Portfolio</li>
                            <li>Company/Studio</li>
                            <li>Student/Professionals</li>
                            <li>Brand</li>
                            <li>College</li>

                        </div>
                    </div>
                
                {/* element 2 */}
                    <div className="dropdown">
                        <button className="dropbtn">Tutorials</button>
                        <div className="dropdown-content">
                            <li>Videos</li>
                            <li>Blogs</li>
                        </div>
                    </div>
                


                {/* element 3 */}
                
                    <div className="dropdown">
                        <button className="dropbtn">Jobs</button>
                        <div className="dropdown-content">
                            <li>Apply for Jobs</li>
                            <li>Post a Job</li>
                        </div>
                    </div>

                    <div classNameName="iconPerson">
                        <div classNameName="myinput"><input classNameName="input-content" type="text" placeholder="Select Language" /></div>
                    </div>

                    <div classNameName="iconsPerson">
                        <div classNameName="iconbtn">
                            <FaUser />
                        </div>
                    </div>
                    <div classNameName="iconsPerson">
                        <div classNameName="iconbtn">
                            <FaShoppingCart />
                        </div>
                    </div>
                </div>
            </LogoNav>
          
          
            {/* <Nav>
                <div classNameName="subnav">
                    {users.map((menuitems) => {return <button>{menuitems.name}</button>})}
                    {/* <div classNameName="subanv-content">
                        {menuitems.material.map((itemcontent) => {return <button>{itemcontent.name1}</button>})}
                    </div> */}
                {/* </div>
            </Nav> */} 



      </Header>
    </>
  );
};



export default HeaderIndexComponent;
